INSERT INTO `b_thing` VALUES (100, '刘德华', '0479ce50-1990-4928-b5eb-e0d8e99a4bcc.jpeg', '大家好，我来自美丽的城市——成都。目前在一家互联网公司担任产品经理，工作比较忙碌，但我乐于面对挑战，享受解决问题的过程。 \r\n\r\n我性格开朗，喜欢结交新朋友，业余时间我喜欢打篮球、看电影和旅行，觉得这些活动能让我放松心情，增广见识。我爱尝试各种美食，尤其是火锅和川菜。如果你也喜欢推荐一些好吃的地方，我们一定会有聊不完的话题。\r\n\r\n我希望能找到一位有共同兴趣、真诚善良的伴侣，共同分享生活的点滴，携手走过未来的每一个阶段。期待能在这里认识到志同道合的你，谢谢！', '15899995555', '乌镇人民路22号', '188cm', '有房有车', '男', '22岁', '律师', '88kg', '0', 0, '1721825566849', 3, 1, 0, 0, 0, 15, '16');
INSERT INTO `b_thing` VALUES (101, '周海玲', 'b68a34a9-4108-4b20-891d-847265bdeb7d.jpeg', '大家好，我是小雅，今年25岁。很高兴能有这样一个机会和大家见面。我来自一个温暖的家庭，目前在一家科技公司工作，担任产品经理。工作之余，我热爱旅行和摄影，喜欢去不同的地方体验不同的文化，也希望能用镜头记录下那些美好的瞬间。\r\n\r\n我的性格比较开朗、乐观，喜欢与人交流，对生活充满好奇。我希望能找到一位志同道合的伴侣，一起分享生活的点滴，互相扶持，共同成长。我希望他有责任感，幽默风趣，能够与我一起享受生活中的点滴快乐。\r\n\r\n期待在这里能遇到那个特别的人，感谢大家的聆听！', '13211111111', '广州市白云区', '177cm', '有房有车', '女', '22岁', '会计', '55kg', '0', 0, '1721825644203', 3, 4, 0, 0, 0, 1, '21');
